const Navbar = () => {
  return (
    <nav className="content">
      <h1 style={{ color: "blue", align: "left" }}>The Dojo Blog</h1>
      <div className="links">
        <a
          href="/"
          style={{
            color: "green",
            backgroundColor: "skyblue",
            borderRadius: "8px",
          }}
        >
          Home
        </a>
        <a
          href="/create"
          style={{
            color: "white",
            backgroundColor: "#f1356d",
            borderRadius: "8px",
          }}
        >
          New Blog
        </a>
      </div>
    </nav>
  );
};

export default Navbar;
